import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import DatePicker from "react-datepicker";
import Select from "@material-ui/core/Select/Select";
import MenuItem from "@material-ui/core/MenuItem/MenuItem";
import FormControl from "@material-ui/core/FormControl/FormControl";
import { makeStyles } from '@material-ui/core/styles';
import clsx from "clsx";

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
    margin: {
        margin: theme.spacing(1),
    },
    textField: {
        width: '25ch',
    },
    root: {
        background: "blue",
    },
    whiteColor: {
        color: "white"
    }
}));


export default function FormDialog() {
    const classes = useStyles();
    const [open, setOpen] = React.useState(false);
    const [floorPlan, setFloorPlan] = React.useState('');

    const handleChange = (event) => {
        setFloorPlan(event.target.value);
    };

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div>
            <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                Schedule a tour
            </Button>
            <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Schedule a tour</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Is there a particular floor plan you would like to tour?
                    </DialogContentText>
                    <FormControl>
                        {/*<InputLabel id="demo-simple-select-label">Floor plan name</InputLabel>*/}
                        <Select
                            classes={{
                                // root: classes.whiteColor,
                                icon: classes.whiteColor
                            }}
                            labelId="demo-simple-select-label"
                            id="demo-simple-select"
                            value={floorPlan}
                            onChange={handleChange}
                        >
                            <MenuItem value={'No, Thank you'}>No, Thank you</MenuItem>
                            <MenuItem value={'1x1(1 bed, 1 bath)'}>1x1(1 bed, 1 bath)</MenuItem>
                            <MenuItem value={'2x2(2 bed, 2 bath)'}>2x2(2 bed, 2 bath)</MenuItem>
                            <MenuItem value={'3x3(3 bed, 3 bath)'}>3x3(3 bed, 3 bath)</MenuItem>
                            <MenuItem value={'4x4(4 bed, 4 bath)'}>4x4(4 bed, 4 bath)</MenuItem>
                        </Select>
                    </FormControl>

                    <br/>
                    <br/>
                    <DatePicker
                        // selected={this.state.date}
                        selected={new Date()}
                        // onChange={this.handleChange}
                        minDate={new Date((new Date()).valueOf() + 1000*3600*24)}
                    />
                    <br/>
                    <TextField
                        className={clsx(classes.margin, classes.textField)}
                        autoFocus
                        margin="dense"
                        required id="first-name"
                        label="First Name"
                    />
                    <TextField
                        className={clsx(classes.margin, classes.textField)}
                        autoFocus
                        margin="dense"
                        required id="last-name"
                        label="Last Name"
                    />
                    <TextField
                        autoFocus
                        margin="dense"
                        required id="email"
                        label="Email Address"
                        type="email"
                        fullWidth
                    />
                    <TextField
                        autoFocus
                        margin="dense"
                        required id="phone"
                        label="Phone"
                        type="number"
                        fullWidth
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Schedule
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
